    "ProductDetails.Afterpay.Popup.Terms.footer": "Late fees and additional eligibility criteria apply.",
    "ProductDetails.Afterpay.Popup.Terms.footer.AU": "See your payment schedule for full breakdown of your instalments and due dates in the Afterpay app or web portal after you check out. Your instalments and due dates will take into account your preferred payment date, and whether no payment upfront or higher upfront payment applies. Late fees, eligibility criteria, and T&Cs apply. Afterpay Australia Pty Ltd Australian Credit Licence 527911.",
    "ProductDetails.Afterpay.Popup.Terms.footer.AU_duplicate": "See your payment schedule for full breakdown of your instalments and due dates in the Afterpay app or web portal after you check out. Your instalments and due dates will take into account your preferred payment date, and whether no payment upfront or higher upfront payment applies. Late fees, eligibility criteria, and T&Cs apply. Afterpay Australia Pty Ltd Australian Credit Licence 527911.",
    "ProductDetails.Afterpay.Popup.Terms.footer.CA": "All you need to apply is to have a Canada-issued Visa / Mastercard debit or credit card, to be over the age of 18 years (Alberta, Manitoba, Ontario, Prince Edward Island, Quebec, Saskatchewan; 19 for all other provinces), and be a resident of Canada. Late fees and additional eligibility criteria apply. For complete terms visit <a class=\"ec-link\" href=\"https://www.afterpay.com/en-CA/instalment-agreement\" target=\"_blank\">www.afterpay.com/en-CA/instalment-agreement</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.ES": "All you need to apply is to have a debit or credit card, to be over the age of 18 years, and be a resident of the country offering {payment}. Late fees and additional eligibility criteria apply. For complete terms visit <a class=\"ec-link\" href=\"https://www.afterpay.com/terms\" target=\"_blank\">www.afterpay.com/terms</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.FR": "All you need to apply is to have a debit or credit card, to be over the age of 18 years, and be a resident of the country offering {payment}. Late fees and additional eligibility criteria apply. For complete terms visit <a class=\"ec-link\" href=\"https://www.afterpay.com/terms\" target=\"_blank\">www.afterpay.com/terms</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.GB": "Clearpay lends you a fixed amount of credit so you can pay for your purchase over 4 instalments, due every 2 weeks. Ensure you can make repayments on time. You must be 18+ and a permanent UK resident (excl Channel Islands). Clearpay charges a £6 late fee for each late instalment and a further £6 if it’s still unpaid 7 days later. Late fees are capped at £6 for orders under £24 and the lower of £24 or 25% of the order value for orders over £24. Missed payments may affect your ability to use Clearpay in the future and your details may be passed onto a debt collection agency working on Clearpay's behalf. Clearpay is credit that is not regulated by the Financial Conduct Authority. T&Cs and other eligibility criteria apply at <a class=\"ec-link\" href=\"https://www.clearpay.co.uk/terms\" target=\"_blank\">www.clearpay.co.uk/terms</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.GB_duplicate": "Clearpay lends you a fixed amount of credit so you can pay for your purchase over 4 instalments, due every 2 weeks. Ensure you can make repayments on time. You must be 18+ and a permanent UK resident (excl Channel Islands). Clearpay charges a £6 late fee for each late instalment and a further £6 if it’s still unpaid 7 days later. Late fees are capped at £6 for orders under £24 and the lower of £24 or 25% of the order value for orders over £24. Missed payments may affect your ability to use Clearpay in the future and your details may be passed onto a debt collection agency working on Clearpay’s behalf. Clearpay is credit that is not regulated by the Financial Conduct Authority. T&Cs and other eligibility criteria apply at <a class=\"ec-link\" href=\"https://www.clearpay.co.uk/terms\" target=\"_blank\">www.clearpay.co.uk/terms</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.IT": "All you need to apply is to have a debit or credit card, to be over the age of 18 years, and be a resident of the country offering {payment}. Late fees and additional eligibility criteria apply. For complete terms visit <a class=\"ec-link\" href=\"https://www.afterpay.com/terms\" target=\"_blank\">www.afterpay.com/terms</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.NZ": "All you need to apply is to have a debit or credit card, to be over the age of 18 years, and be a resident of the country offering {payment}. Late fees and additional eligibility criteria apply. For complete terms visit <a class=\"ec-link\" href=\"https://www.afterpay.com/terms\" target=\"_blank\">www.afterpay.com/terms</a>",
    "ProductDetails.Afterpay.Popup.Terms.footer.US": "You must be over 18, a resident of the U.S. and meet additional eligibility criteria to qualify. Late fees apply. Estimated payment amounts shown on product pages exclude taxes and shipping charges, which are added at checkout. Loans to California residents made or arranged pursuant to a California Finance Lenders Law license. Click <a class=\"ec-link\" href=\"https://www.afterpay.com/purchase-payment-agreement\" target=\"_blank\">here</a> for complete terms.",
